import React from "react";

export default function Main(props: any){
    const {products} = props;
    return(
        <main className="block col-2">
            <h2>Products</h2>
            <div className="row">
                {products.map((product) => (
                    <Product key={product.id} product={product} />
                ))}
            </div>
        </main>
    )
}
